import{_ as a,p as i,q as e,Y as l}from"./framework-aa5c4115.js";const h={},r=l('<h2 id="八月份" tabindex="-1"><a class="header-anchor" href="#八月份" aria-hidden="true">#</a> 八月份</h2><h3 id="_08-01" tabindex="-1"><a class="header-anchor" href="#_08-01" aria-hidden="true">#</a> 08-01</h3><ul><li>今天 8.1 换公司第一天报到就下大雨，离谱到家了。</li><li>还是老样子，介绍一下自己了，之后拉进群聊再欢迎一下，还挺有仪式感的。</li><li>前几天熟悉项目了，jquery 的项目，我瞬间明白了，一定是需要重构一下....</li></ul><h3 id="_08-04" tabindex="-1"><a class="header-anchor" href="#_08-04" aria-hidden="true">#</a> 08-04</h3><ul><li>听说过科大讯飞吗？智能语音行业龙头老大吧，没想到我要和他进行切磋。</li></ul><h3 id="_08-07" tabindex="-1"><a class="header-anchor" href="#_08-07" aria-hidden="true">#</a> 08-07</h3><ul><li>新的一周，这周看原生安卓的科大讯飞。</li></ul><h3 id="_08-11" tabindex="-1"><a class="header-anchor" href="#_08-11" aria-hidden="true">#</a> 08-11</h3><ul><li>5:30下班了，到点直接溜之大吉。</li><li>回家换个衣服坐地铁去松江，朋友请我吃心心念念的大盘鸡，最后看了“孤注一掷”，很值得看，感触很深。</li></ul><h3 id="_08-13" tabindex="-1"><a class="header-anchor" href="#_08-13" aria-hidden="true">#</a> 08-13</h3><ul><li>今天下午去了 “一大会址纪念馆” 给自己上党课。</li><li>本应该第一站就去的，开始在松江住离得确实很远，接下来去博物馆，东方明珠...</li></ul><h3 id="_08-15" tabindex="-1"><a class="header-anchor" href="#_08-15" aria-hidden="true">#</a> 08-15</h3><ul><li>ok，科大讯飞项目告急，老板亲自研究了，主要他真的是纯原生安卓的开发。</li></ul><h3 id="_08-18" tabindex="-1"><a class="header-anchor" href="#_08-18" aria-hidden="true">#</a> 08-18</h3><ul><li>这周又开始了新的目标，客户临时提要求需要修改页面的数据显示方式，由于老项目的数据监控页面不够炫酷（偏政府嘛，都懂），客户发来参考页面进行修改，这下就交给我了；</li></ul><h3 id="_08-19" tabindex="-1"><a class="header-anchor" href="#_08-19" aria-hidden="true">#</a> 08-19</h3><ul><li>还好我有先见之明，提前做好路由，mock 数据，不至于太头疼。由于项目已经交付了，修改页面还很着急，ui 也纯属过家家，到我这里确实又头疼的无从下手了，只能先改着。</li></ul><h3 id="_08-25" tabindex="-1"><a class="header-anchor" href="#_08-25" aria-hidden="true">#</a> 08-25</h3><ul><li>页面修改差不多，还要先看看先给客户效果....</li></ul><h3 id="_08-29" tabindex="-1"><a class="header-anchor" href="#_08-29" aria-hidden="true">#</a> 08-29</h3><ul><li>舒服（hu），双休干嘛？我整整在家躺了两天（顺带手帮之前同学做了简历），</li><li>大学同学结婚的好多，我也发现了规律：</li><li>男孩在学校谈恋爱的毕业之后没有很快结婚的，有 但是很少；也确实男孩谈恋爱的一般长得还说得过去，要不就肯定单身了，除非个别例外。</li><li>而女孩，由于我上大学期间帮同学刷网课导致朋友圈确实也很多女孩（不过我不认识，只是看到漂亮自拍或者风景再或者生日什么地会点赞）</li><li>当然，朋友圈结婚的及多数是相亲（女生居多，当然男孩可能不发朋友圈，再当然 人生大事怎能不发朋友圈？ 话不能说太满总要有余地的）</li><li>打个比方吧：可能朋友圈女孩上学期间从来没有谈过恋爱（也可能谈了没有发朋友圈，也可能发了凑巧我没看到），但是某一天突然发朋友圈订婚了，紧接着过几个月结婚了。我希望你能懂我想表达的意思。</li><li>比如（男孩工作两年左右找一个刚毕业的女孩，结婚正合适，能懂吗？）</li><li>说到最后我只是想 ⚪ 一下自己内心的想法，仅此而已。</li><li>再比如 ：别人看你的第一眼或者某一件事就已经对你形成了固有印象，你再改变都是没用的。我是想说别活在别人的眼里，太累。</li></ul>',21),d=[r];function n(t,c){return i(),e("div",null,d)}const _=a(h,[["render",n],["__file","23-08.html.vue"]]);export{_ as default};
